	router.GET(baseURL+"/v1/auth/bearer", wrapper.FormBinaryBearer)
	router.OPTIONS(baseURL+"/v1/auth/bearer", wrapper.OptionsAuthBearer)
	router.GET(baseURL+"/v1/containers", wrapper.ListContainers)
